import React from 'react'
import './search-panel.sass'

function SearchPanel() {
    return (
      <div className='search-panel'>
        <input
          type='text'
          className='form-control search-input'
          placeholder='Find employee'
        />
      </div>
    );
}

export default SearchPanel;
